INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2989, 14611, 'Teriflunomide', 'The recent, concomitant, or subsequent use (without the recommended leflunomide washout period or procedure) of other agents known to induce hepatotoxicity may potentiate the risk of liver injury associated with leflunomide.  The risk is thought to extend to teriflunomide, its principal active metabolite, because recommended dosages of both result in a similar range of plasma concentrations of teriflunomide.  Elevated liver transaminases, hepatitis, jaundice/cholestasis, hepatic failure, and acute hepatic necrosis have been reported with the use of leflunomide.  Liver enzyme elevations were generally mild (2 times the upper limit of normal or less) and resolved while continuing treatment.  Marked elevations (greater than 3-fold ULN) occurred infrequently and reversed with dose reduction or discontinuation of treatment in most cases.', 'alcohol', 'Major', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (2991, 23204, 'Thalidomide', 'Alcohol may potentiate some of the pharmacologic effects of CNS-active agents.  Use in combination may result in additive central nervous system depression and/or impairment of judgment, thinking, and psychomotor skills.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
