INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3028, 24890, 'Tiludronic acid', 'Food significantly decreases the bioavailability of tiludronate.  The manufacturer reports up to a 90% decrease in bioavailability when administered with or 2 hours after a standard breakfast.  Clinical efficacy, however, was demonstrated when tiludronate was taken 2 hours before or after meals.', 'food', 'Moderate', '', 'DDInter', 0, X'789c3d8cb10dc3300c0457f90952a408328817a0430a2620eb039282d78fdca43ddcdde67d6a704819f2e0ec8add207afaf02c0b535c5e075e28e20dcef1b1041bbe5d7ce05a5d400add240b4fac45e45a348681f127d26eb191faf8017a3a2911', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3030, 2880, 'Benzatropine', 'Use of anticholinergic agents with alcohol may result in sufficient impairment of attention so as to render driving and operating machinery more hazardous.  In addition, the potential for abuse may be increased with the combination.  The mechanism of interaction is not established but may involve additive depressant effects on the central nervous system.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c358ddb11c2300c045bb90ad2031dd082b09558836283252793ee51207c6846afdbbd696aa529acb4a1190b57eea47ae0c1a0ad49e68c3cbad4055ee2f43ab08b175075491194f85f248122e93601777239db3f3138a98d6aac41f2f6838292cb26f169e8fc1ef215ac9123052977af6c8611123dbd079eb5ed285131195f3ad03c73f273b74e1f290b4be3', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3031, 9104, 'Timolol', 'Many psychotherapeutic and CNS-active agents (e.g., anxiolytics, sedatives, hypnotics, antidepressants, antipsychotics, opioids, alcohol, muscle relaxants) exhibit hypotensive effects, especially during initiation of therapy and dose escalation.  Coadministration with antihypertensives and other hypotensive agents, in particular vasodilators and alpha-blockers, may result in additive effects on blood pressure and orthostasis.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
